import React from "react";


const Groups = () => {

    const [lg, setState] = React.useState([
        {id:1, img:"../images/cake.PNG", name:"cake group"}

    ]);

    return (
        <div>
            {lg.map((i) => (
            <div key = {i.id} >
                <div>
                    <img src="./images/cake.PNG"/>
                </div>
                <div> {i.name} </div>
            </div>
            ))}
        </div>

    )
}

export default Groups;
